import React, {Component} from 'react';
import {Link} from "react-router-dom";
import DocumentTitle from 'react-document-title'
import './App.css';


class Vibor extends Component {
    render() {
        return (
            <DocumentTitle title = 'Военкомат'>
            <div className={"vibor"}>
                <h1>Военкомат Moscow</h1>
                <h2>Выберите кто вы</h2>
                <qw><Link to="/priziv">Военный комиссар</Link></qw>
            <br/>
                <Link to="/komissar">Призывник</Link>
            </div>


            </DocumentTitle>

        );
    }
}

export default Vibor;
